    false,nt"url": null,nt"notes": "The inventory procedures outlined in this
    plan represent a cost effective inventory of the wildlife populations on St. Vincent
    National Wildlife Refuge.  Winter waterfowl will be monitored through ground censusing,
    wood duck production will be monitored through duck box inspections, and bald eagles
    nests will be examined on a monthly basis during nesting season.  Sea turtle nests
    will be checked on a daily basis during nesting season, osprey nests will be located
    through an aerial survey, and alligator counts will be made one hour after sunset.
     White-tailed deer will be monitored through harvest data and track counts, shorebirds
    will be monitored through ground surveys, and rookery surveys will be conducted
    to monitor colonial birds.",nt"license_title": "License Not Specified",nt"extras":
